import React from 'react'
import svg from './imgs/avataaars.svg'

function Start() {
  return (
    <div className='d-flex justify-content-center align-align-items-center vh-100'>
      <div>
      <img src={svg} className='w-100' alt="" />
      </div>
    </div>
  )
}

export default Start
